import {useState} from 'react';
import {useDispatch, useSelector} from 'react-redux';




export const reducer = (state = {}, action) => {
    return state;
};

const App = () => {
    return (
        <div>
            <form>
                <input />
                <button>Mostrar todos</button>
                <button>Completados</button>
                <button>Incompletos</button>
                <ul>
                    <li>todo 1</li>
                    <li>todo 2</li>
                </ul>
            </form>
        </div>
    );
};

export default App;
